//var FindMaxConsecutiveOnesResponse = FindMaxConsecutiveOnes(FindMaxnums2);

int FindMaxConsecutiveOnes(int[] nums)
{
    int response = 0;
    int responsefinal = 0;

    foreach (int num in nums)
    {
        if(num == 1)
        {
            response++;
        }
        if(num==0)
        {
            if (response > responsefinal)
            {
                responsefinal = response;
            }
            response = 0;  //whether we update the final count or not, our counter should return to zero.
        }
    }
    if(response > responsefinal)
    {
        return response;
    }

    return responsefinal;
}

