//var resFindNumbers = FindNumbers(FindNumbersnums);

int FindNumbers(int[] nums)
{
    var response = 0;

    foreach(var x in nums)
    {
        //convert into string. count the digits.
        var xString = x.ToString();
        if (xString.Length % 2 == 0)
            response++;
    }
    

    return response;
}

