//var responseSortedSquares = SortedSquares(SortedSquaresnums);
int[] SortedSquares(int[] nums)
{
    var responseCollection = new List<int>();

    foreach(var x in nums)
    {
        var y = x * x;
        responseCollection.Add(x * x);
    }
    responseCollection.Sort();

    return responseCollection.ToArray<int>();
}

