#region 1089. Duplicate Zeros

//https://leetcode.com/problems/duplicate-zeros/

var DuplicateZerosarr = new int[] { 1, 0, 2, 3, 0, 4, 5, 0 };
//DuplicateZeros(DuplicateZerosarr);
void DuplicateZeros(int[] arr)
{
    var arrayCount = arr.Length;//the target array cannot exceed the lenght of the original array
    var originalarray = new int[arrayCount];
    arr.CopyTo(originalarray, 0);
    int j = 0;//track the position of the original array
    for(int i = 0; i < arrayCount; i++)
    {
        if (originalarray[j] == 0) //original array uses the j tracker which runs at regular speed
        {
            arr[i] = 0;
            i++; //i moves as per the target array
            if(i<arrayCount)  //in case the zero is all the way at the end.
                arr[i] = 0;
        }
        else
        {
            arr[i] = originalarray[j];
        }
        j++;
    }
}

