#region 88. Merge Sorted Array

//1. https://leetcode.com/problems/merge-sorted-array/
var Mergenums1 = new int[] { 2, 0 };
var Mergenums2 = new int[] { 1 };
var Mergem =2;
var Mergen = 1;

Merge(Mergenums1, Mergem, Mergenums2, Mergen);

void Merge(int[] nums1, int m, int[] nums2, int n)
{
    var firstArrayUnTouched = new int[nums1.Length];
    nums1.CopyTo(firstArrayUnTouched,0);
    int j = 0; //trackers for the first set of sorted numbers
    int k = 0; //trackers for the second set of sorted numbers

    if(m==0 && n == 0)
    {
        //both arrays are 0. do nothing
    }
    else if(m>=1 && n == 0)
    {
        //second array is empty. there is nothing for us to do. 
    }
    else if (m==0 && n >=1)
    {
        //first array empty, but second array has elements
        //copy the second array to the first array
        nums2.CopyTo(nums1, 0);
    }
    else //both m and n are positve and non-zero
    {
        for (var i = 0; i < firstArrayUnTouched.Length; i++) //we need a new array equal to the lenght of the original array
        {
            if (j >= m)
            {
                nums1[i] = nums2[k];//just copy all the elements of the second array. first array has been exhausted
                k++;
            }
            else if( k >=n)
            {
                nums1[i] = firstArrayUnTouched[j];//just copy all the elements of the first array. second array has been exhausted
                j++;
            }    
            else if (firstArrayUnTouched[j] <= nums2[k])
            {
                nums1[i] = firstArrayUnTouched[j];
                j++;//number taken from the first set. move the first marker.
            }
            else
            {
                nums1[i] = nums2[k];
                k++; //number taken from the second set, move the second marker.
            }

        }
    }



}

